    console.log('requestTweenByID: deltaID = ' + repr(deltaID) + ' and time = ' + repr(time));
    requestTween(getDeltaByID(deltaID), time, ignoreBlocking, isAuto);
  } else {
    tween.delta = {
      scene: {
        transitions: {
          auto: null
        }
      } //This saves us from having to rewrite 'scene	transitions	auto	null' all over the place (otherwise, if we enter some delta with auto, by default (if that delta doesnt set scene	transitions	auto	null), we'll be stuck there forever.)

    };
    console.log('requestTweenByID: Skipping tween ' + repr(deltaID) + ' because it would have no effect (the gamestate contains it allready)');
  }
