window.requestTween = function (delta, time = 0, ignoreBlocking = false, isAuto = false) {
  //if ignoreBlocking is true, it will override the transition blocker
  //Tweens will be denied if we are in the middle of a transition
  console.assert(arguments.length >= 1, 'Wrong number of arguments.');

  if (tween.time && !ignoreBlocking) {
    console.log("Blocked Transition (another transition is still tweening)");
    return;
  } //Don't allow more than one tween at a time


  if (!isAuto && autoIsPending()) return; //Don't let the user screw up the game

  if (delta.sound && typeof delta.sound === 'string') playSound(config.sounds[delta.sound]);
  deltas.pour(tween._initialDelta, {
    scene: {
      transitions: {
        auto: null
      }
    }
  }); //This saves us from having to rewrite 'scene	transitions	auto	null' all over the place (otherwise, if we enter some delta with auto, by default (if that delta doesnt set scene	transitions	auto	null), we'll be stuck there forever.)

  deltas.pour(tween._targetDelta, {
    scene: {
      transitions: {
        auto: null
      }
    }
  });
  tween.time = time;
  tween.delta = delta;
};

